import React from 'react';
import { Instagram, Twitter, Youtube, Calendar, Mail } from 'lucide-react';
import './HomePage.css';

const HomePage = () => {
    const links = [
        {
            title: 'Instagram',
            subtitle: 'Daily comedy & reels',
            icon: <Instagram size={22} />,
            href: 'https://instagram.com/onkaryadav',
            color: '#E4405F'
        },
        {
            title: 'YouTube',
            subtitle: 'Clips & full sets',
            icon: <Youtube size={22} />,
            href: 'https://www.youtube.com/@boi_onkar',
            color: '#FF0000'
        },
        {
            title: 'Twitter',
            subtitle: 'One-liners & updates',
            icon: <Twitter size={22} />,
            href: 'https://twitter.com/onkaryadav',
            color: '#1DA1F2'
        },
        {
            title: 'Book a show',
            subtitle: 'Corporate • College • Private',
            icon: <Calendar size={22} />,
            href: 'mailto:bookings@onkaryadav.com',
            color: '#16a34a'
        },
        {
            title: 'Email',
            subtitle: 'Collabs • Press • Queries',
            icon: <Mail size={22} />,
            href: 'mailto:info@onkaryadav.com',
            color: '#6366f1'
        }
    ];

    return (
        <div className="homepage">
            <div className="container">
                {/* Profile */}
                <div className="profile-section">
                    <div className="profile-image">
                        <img
                            src="https://images.unsplash.com/photo-1507003211169-0a1dd7228f2d?w=200&h=200&fit=crop&crop=face"
                            alt="Onkar Yadav"
                            onError={(e) => {
                                e.currentTarget.src = 'https://via.placeholder.com/200x200/333/fff?text=OY';
                            }}
                        />
                    </div>
                </div>

                {/* Links */}
                <div className="links-section">
                    {links.map((link) => (
                        <a
                            key={link.title}
                            href={link.href}
                            className="link-card"
                            target="_blank"
                            rel="noopener noreferrer"
                            style={{ ['--accent']: link.color }}
                        >
                            <div className="link-icon" style={{ color: link.color }}>
                                {link.icon}
                            </div>
                            <div className="link-content">
                                <h3>{link.title}</h3>
                                <p>{link.subtitle}</p>
                            </div>
                        </a>
                    ))}
                </div>

                <div className="footer">
                    <p>© {new Date().getFullYear()} Onkar Yadav</p>
                </div>
            </div>
        </div>
    );
};

export default HomePage;
